  const [isStartScreen, setIsStartScreen] = useState(false);
  // <div className="container text-center text-blue-800">
  return (
    <StartScreen
      isFormSubmitted={isStartScreen}
      setIsFormSubmitted={setIsStartScreen}
    />
  );
}

export default App;
